import React from "react";
//https://hips.hearstapps.com/hmg-prod/images/happy-male-athlete-listening-music-on-treadmill-in-royalty-free-image-1580752391.jpg
const WorkoutContainer= ({workout}) =>{
    return(
<div className="workout">
    <div>
      <p>Rs {workout.cost}/-</p>
    </div>
    <div>
        <img src={workout.image} alt="cardio"/>
    </div>
    <div>
        <span>{workout.subscription}</span>
        <h3>{workout.description}</h3>
    </div>
</div>



    );
}

export default WorkoutContainer;
